INSERT INTO `v1_37c4c52da54dc3ce626d2a2c13c69dbb1f01973be7a1c7e328c9f5c069452901` VALUES (1, "スタンダードコレクション", 3, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", 1, "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_37c4c52da54dc3ce626d2a2c13c69dbb1f01973be7a1c7e328c9f5c069452901` VALUES (1, "プレミアムコレクション", 10, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 2, "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！");
INSERT INTO `v1_37c4c52da54dc3ce626d2a2c13c69dbb1f01973be7a1c7e328c9f5c069452901` VALUES (1, "フェスコレクション", 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", 3, "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！");
